import React from 'react';
import '../App.css';

export default class Banner extends Component {
  render() {
    return (
      <div className='container '>
        <div className='image'>
          <img
            src={require('../images/996x500_HERO_PAYDAYUPTO70EXTRA20_WOMEN.gif')}
            alt='banner'
          />
        </div>
      </div>
    );
  }
}
